import React, { useState } from "react";
import { Link } from "react-router-dom";
import { motion, AnimatePresence } from "framer-motion";
import "./homepage.css";

export const HomePage = () => {
  const [showIntro, setShowIntro] = useState(true);
  const [showBookNow, setShowBookNow] = useState(false);

  const wordVariants = {
    hidden: { opacity: 0, x: -50 },
    visible: { opacity: 1, x: 0, transition: { duration: 2 } },
  };

  const handleIntroComplete = () => {
    setShowIntro(false);
    setShowBookNow(true);
  };

  return (
    <AnimatePresence mode="wait">
      <motion.div
        className="container"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        exit={{ opacity: 0 }}
        key="homepage"
      >
        <div className="home-content">
          <div className="main-content">
            <div className="content-wrapper">
              {showIntro && (
                <div
                  style={{
                    fontFamily: "monospace",
                    fontSize: "200px",
                    color: "#000000",
                    textAlign: "left",
                  }}
                >
                  <motion.div
                    initial="hidden"
                    animate="visible"
                    variants={wordVariants}
                    style={{ display: "inline-block" }}
                    onAnimationComplete={handleIntroComplete}
                  >
                    <motion.span variants={wordVariants}>JSM</motion.span>
                  </motion.div>
                  <br />
                  <motion.div
                    initial="hidden"
                    animate="visible"
                    variants={wordVariants}
                    transition={{ delay: 0.5 }}
                    style={{ display: "inline-block" }}
                  >
                    <motion.span variants={wordVariants}>The</motion.span>
                  </motion.div>
                  <br />
                  <motion.div
                    initial="hidden"
                    animate="visible"
                    variants={wordVariants}
                    transition={{ delay: 1 }}
                    style={{ display: "inline-block" }}
                  >
                    <motion.span variants={wordVariants}>Barber</motion.span>
                  </motion.div>
                </div>
              )}

              {showBookNow && (
                <div>
                  <h2>Welcome to JSM's Chop Shop</h2>
                  <p>
                    Experience the best hair cutting and styling services in
                    town.
                  </p>
                  <Link to="/ScheduleAppt">
                    <motion.button
                      className="book-now"
                      whileHover={{ scale: 1.1 }}
                      whileTap={{ scale: 0.9 }}
                    >
                      Book Now
                    </motion.button>
                  </Link>
                </div>
              )}
            </div>
          </div>
        </div>
        <div className="footer">
          <p>&copy; 2024 JSM's Chop Shop. All rights reserved.</p>
        </div>
      </motion.div>
    </AnimatePresence>
  );
};

// Example of how to use motion with react-router-dom Link
export const Navigation = () => {
  return (
    <div>
      <Link to="/home">
        <motion.button
          whileHover={{ scale: 1.1 }}
          whileTap={{ scale: 0.9 }}
          className="gradient-button"
        >
          <span className="label">HOME</span>
          <div className="transition"></div>
        </motion.button>
      </Link>
      <Link to="/signup">
        <motion.button
          whileHover={{ scale: 1.1 }}
          whileTap={{ scale: 0.9 }}
          className="gradient-button"
        >
          <span className="label">SIGNUP</span>
          <div className="transition"></div>
        </motion.button>
      </Link>
      <Link to="/login">
        <motion.button
          whileHover={{ scale: 1.1 }}
          whileTap={{ scale: 0.9 }}
          className="gradient-button"
        >
          <span className="label">LOGIN</span>
          <div className="transition"></div>
        </motion.button>
      </Link>
    </div>
  );
};
